import React from 'react';

class List extends React.Component {

    render() {
        return (
            <ul className="todoList">
                {
                    this.props.listItems.map(item => (
                        <li onClick={ () => alert('clicked') }>{ item }</li>
                    ))
                }
            </ul>
        )
    }
}

export default List;
